import React, { useEffect } from 'react'
import Cookies from 'js-cookie';

export const Logout = () => {

    const logout = () => {
        Cookies.remove('access_token_cookie', {path: '/', domain: 'localhost'});
        Cookies.remove('csrf_access_token');
        Cookies.set('loggedIn', '0');
    }

    useEffect(() => {
        logout();
        setTimeout(() => {
            window.location = "/"
        }, 3000)
    }, [])

    return (
        <div>Logout</div>
    )
}
